commits.sourceNew:
private final void addToFront(HitDoc hitDoc) {  // insert at front of cache
  if (first == null)
    last = hitDoc;
  else
    first.prev = hitDoc;

  hitDoc.next = first;
  first = hitDoc;
  hitDoc.prev = null;

  numDocs++;
}

private final void addToFront(HitDoc hitDoc) {  // insert at front of cache
    if (first == null) {
        last = hitDoc;
    } else {
        first.prev = hitDoc;
    }

    hitDoc.next = first;
    first = hitDoc;
    hitDoc.prev = null;

    numDocs++;
}

